import React from 'react';


const Card = ({name, id, onItemClick}) => {
    if (id < 650) {
        const imageURL = `https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/other/dream-world/${id}.svg`
    } else {
        const imageURL = `https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/other/home/${id}.png`
    }
    return (
        <div className='tc bg-pokemon-yellow dib br3 pa3 ma3 grow bw2 shadow-5'
            onClick={onItemClick}>
                {
                                <img className="h5 w5" id={id} alt="pokemon" src={imageURL} />

                }
            <h2>{name}</h2>
        </div>
    );

}


export default Card;
